import React from "react";
import headshot from "../../assets/about/headshot.jpg";
import { Typography, IconButton } from "@material-ui/core";
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import { Element } from "react-scroll";
import "./AboutMe.scss";

const AboutMe = () => {
  return (
    <React.Fragment>
      <Typography
        variant="h2"
        display="block"
        align="center"
        style={{
          margin: "1rem",
          fontSize: "1.6rem",
          textTransform: "uppercase"
        }}
      >
        {/*  <Element name="about-me" id="about-me">
                About Me
            </Element> */}
      </Typography>
      <div className="name">
        <img src={headshot} alt="profile_photo" className="img" />
        <h1>Kevin Schroeder</h1>
        <div className="subtitle">
          <h3>I am a Full Stack Software Engineer</h3>
          <p>REACT || Ruby on Rails || JavaScript || PHP</p>
        </div>
      </div>
    </React.Fragment>
  );
};

export default AboutMe;
